var bgs=JSON.parse('[\n    "back_blue.png",\n    "back_purple.png",\n    "back_red.png",\n    "back_xp.jpg",\n    "back_car.jpg",\n    "back_old.jpg",\n    "back_may.png",\n    "back_elon.jpg",\n    "back_sl_server.jpeg"\n]'),r=Math.floor(Math.random()*bgs.length),bg=document.getElementById("bg");bg.style.backgroundImage="url('bgs/"+bgs[r]+"')";var date=new Date,m=date.getMonth(),d=date.getDate(),y=date.getFullYear(),eventSpace=document.getElementById("eventSpace");if(12==m&&(25==d||26==d)){var eventText='<br><h1 class="c"><i class="fas fa-gift"></i> Happy Holidays! <i class="fas fa-gift"></i></h1>';eventSpace.innerHTML=eventText}if(1==m&&d>=1&&d<=5){var eventText='<br><h1 class="c"><i class="fas fa-glass-cheers"></i> Happy New Year! <i class="fas fa-glass-cheers"></i></h1>';eventSpace.innerHTML=eventText}if(8==m&&d>=11&&d<=18){var yearPass=y-2018,eventText=`\n    <br>\n    <h1 class="c"><i class="fas fa-cross"></i></h1>\n    <h2 class="c">RIP Terry Andrew Davis</h2>\n    <p class="c">August 11 marks the ${yearPass} year of his passing.</p>\n    <p class="c">My archive of his work and photos is at the bottom.</p>\n    <p class="c">Light a candle in his honor.</p>\n    `;eventSpace.innerHTML=eventText}